import '../yourProfile.scss'
import { connect } from 'react-redux';
import './auctionManager.scss'
import { getAuctionWithWinnersForManagerFromDB } from '../../../utils/auctionUtils';
import React, { useEffect, useState } from "react";

import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import Divider from '@mui/material/Divider';
import ListItemText from '@mui/material/ListItemText';
import ListItemAvatar from '@mui/material/ListItemAvatar';
import Avatar from '@mui/material/Avatar';
import Typography from '@mui/material/Typography';
const AuctionResults = (props) => {

    useEffect(() => {
        if (props.auction)
            getAuctionWithWinnersForManagerFromDB(props.auction._id).then(succ => {
                setProductsList(succ.data.productList);//רשיתמ מוצרים עם הזוכים של מכירה זו
                console.log(succ.data)
            });
        else window.location = "http://localhost:3000/your_profile"
    }, []);

    let [productsList, setProductsList] = useState([]);

    return (<>
        {props.auction &&
            (<>
                <h1>{props.auction.organizationName ? props.auction.organizationName + " - " : ""}{props.auction.name}</h1>
                <h2>Chinese auction results</h2>
                {productsList.map((p, index) => {
                    if (p.winnerId) return <p key={index}>{p.name}:{p.winnerId.userName}</p>
                    else return <p key={index}>{p.name}</p>
                })}

            </>)}

        <List sx={{ width: '100%', maxWidth: 360, bgcolor: 'background.paper' }}>
            <ListItem alignItems="flex-start">
                <ListItemAvatar>
                    <Avatar alt="Remy Sharp" src="/static/images/avatar/1.jpg" />
                </ListItemAvatar>
                <ListItemText
                    primary="Brunch this weekend?"
                    secondary={
                        <React.Fragment>
                            <Typography
                                sx={{ display: 'inline' }}
                                component="span"
                                variant="body2"
                                color="text.primary"
                            >
                                Ali Connors
                            </Typography>
                            {" — I'll be in your neighborhood doing errands this…"}
                        </React.Fragment>
                    }
                />
            </ListItem>
            <Divider variant="inset" component="li" />
            <ListItem alignItems="flex-start">
                <ListItemAvatar>
                    <Avatar alt="Travis Howard" src="/static/images/avatar/2.jpg" />
                </ListItemAvatar>
                <ListItemText
                    primary="Summer BBQ"
                    secondary={
                        <React.Fragment>
                            <Typography
                                sx={{ display: 'inline' }}
                                component="span"
                                variant="body2"
                                color="text.primary"
                            >
                                to Scott, Alex, Jennifer
                            </Typography>
                            {" — Wish I could come, but I'm out of town this…"}
                        </React.Fragment>
                    }
                />
            </ListItem>
            <Divider variant="inset" component="li" />
            <ListItem alignItems="flex-start">
                <ListItemAvatar>
                    <Avatar alt="Cindy Baker" src="/static/images/avatar/3.jpg" />
                </ListItemAvatar>
                <ListItemText
                    primary="Oui Oui"
                    secondary={
                        <React.Fragment>
                            <Typography
                                sx={{ display: 'inline' }}
                                component="span"
                                variant="body2"
                                color="text.primary"
                            >
                                Sandra Adams
                            </Typography>
                            {' — Do you have Paris recommendations? Have you ever…'}
                        </React.Fragment>
                    }
                />
            </ListItem>
        </List>
    </>
    );

}

const mapStateToProps = (state) => {
    return {
        auction: state.auctionManager.selected_auction_to_options

    };
}
export default connect(mapStateToProps, {})(AuctionResults);
